import React from "react";

const ItemCardPage = () => {
    return (
        <>
            <div className="card" style="width: 18rem;">
                <div className="card-body">
                    <h5 className="card-title">Город</h5>
                    <h6 className="card-subtitle mb-2 text-muted">Общая информация</h6>
                    <p className="card-text">Прогноз погоды</p>
                    <button type="button" class="btn btn-secondary">Добавить в избранное</button>
                </div>
            </div>
        </>
    )
}

export default ItemCardPage;
